- 初始化最小价格 `minPrice` 为整数最大值,最大利润 `maxProfit` 为 0
- 遍历价格数组 `prices`
  - 如果当前价格小于 `minPrice`,更新 `minPrice` 为当前价格
  - 否则,如果当前价格减去 `minPrice` 大于 `maxProfit`,更新 `maxProfit`
- 返回 `maxProfit`

